import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [message, setMessage] = useState('');

  useEffect(() => {
    fetch('/api/test')
        .then(response => response.text())
        .then(message => setMessage(message));
  }, []);

  return (
      <div className="App">
        <header className="App-header">
          <h1>{message}</h1>
        </header>
      </div>
  );
}

export default App;
